	public String minWindow(String s, String t) {
		Map<Character,Integer> t_map = new HashMap<Character,Integer>();
		Map<Character,Integer> s_map = new HashMap<Character,Integer>();
		int min = Integer.MAX_VALUE;
		int minstart=0,minend=0,start=0,end;
		
		char[] sp = t.toCharArray();
		for(int i=0; i<t.length();i++){
			if(!t_map.containsKey(sp[i])){
				t_map.put(sp[i], 0);
			}
			t_map.replace(sp[i], t_map.get(sp[i])+1);
		}
		
		sp = s.toCharArray();
		int count = 0;
		for(int i=0;i<sp.length;i++){
			if(t_map.containsKey(sp[i])){
				if(!s_map.containsKey(sp[i])){
					s_map.put(sp[i], 0);
				}
				s_map.replace(sp[i], s_map.get(sp[i])+1);
				if(s_map.get(sp[i]) <= t_map.get(sp[i])){
					count++;
				}
			}
			
			if(count == t.length()){
				end =i;
				while(start < end){
					if(s_map.containsKey(sp[start])){
						if(s_map.get(sp[start]) == t_map.get(sp[start])){
							break;
						}
						s_map.replace(sp[start], s_map.get(sp[start])-1);
					}
					start++;
				}
				if((end-start+1)<min){
					min = end-start+1;
					minstart = start;
					minend = end+1;
				}
				s_map.replace(sp[start],s_map.get(sp[start])-1);
				start++;
				count--;
			}
		}
		if(min == Integer.MAX_VALUE){
			return "";
		}
		else{
			return s.substring(minstart,minend);
		}
	}
	
	
